                    <div className="card">
                    <div className="card-body">
                        <h5 className="card-title">valores</h5>
                        <p className="card-text">En Construccion</p>
                        <h4>{this.state.prioridad1} {this.state.prioridad2}</h4>
                    </div>
                    </div>
                </div>           
            </div>
          </div>            
      )
    }

}
